Overview:
Equissage is the most versatile, safest & easiest way to help your horses recover to their peak form and speed up the healing time of injuries.

Equissage leads the way in Equine Therapy and have been helping people and animals since 1949, enjoying a strong following both in and outside of Australia as it has been recognized as the most versatile, safest and easiest way to assist your horse maintain and recover to their peak form by increasing the natural healing time.

Australian owned and made, the Equissage Cycloid Vibration Therapy (CVT) device is a multi-unit horse therapy massage system specifically built for equine used to stimulate blood circulation, assist with lymphatic drainage, relax muscles and help with increased joint mobility.

The concept of Equissage was designed for humans and subsequently refined for equine use and produces results that will amaze even the most serious equine professionals.

Equissage pioneered this form of therapy on horses and its parent company CT Healthcare manufacture all of its equipment and the range of Niagara Therapy CVT medial devices in its state of the art Brisbane manufacturing facility.

Your horse’s circulation system holds the key to maintaining peak condition, healing injuries and improving performance.

Equissage manufacture in Brisbane a range of Equine CVT Massage Therapy Devices that are proven to:

Improve blood circulation;
Relax muscle while supplying passive exercise; and
Improve nerve muscle communication.

With regular use of Equissage, you can improve:

Local blood circulation;
Venous drainage;
Improve Blood and Lymphatic drainage;
Swollen joints;
Joint mobility;
Respiratory problems;
Sore and cold backs;
Lactic acid;
Fibrinogen Vertebrae problems;
Pre-racing condition;
Post-race stiffness;
Pulled ligaments;
Sore shins;
Swollen joints, knees and tendons;
Colic;
Laminitis; and
Bruises and foot abscesses.
